import Editor from "../component/Editor";

const Home = () => {
    return (
        <div>
            <Editor
                initData={{
                    date: new Date().getTime(),
                    emotionId: 1,
                    content: "이전에 작성했던 일기",
                }}
                onSubmit={() => {
                    alert(("작성이 완료되었습니다"));
                }}   
            />      
        </div>
    );
};

export default Home;
